import React, { useState, useRef, useEffect } from 'react';
import styled, { keyframes } from 'styled-components';
import Logo from './Logo';

const Navbar = () => {
  const [activeLink, setActiveLink] = useState('home');
  const [isServicesOpen, setIsServicesOpen] = useState(false);
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);
  const dropdownRef = useRef(null);
  const mobileMenuRef = useRef(null);

  const handleLinkClick = (linkName, e) => {
    e.preventDefault();
    setActiveLink(linkName);
    if (linkName !== 'services') {
      setIsServicesOpen(false);
    }
    setIsMobileMenuOpen(false);
  };

  const toggleServicesDropdown = (e) => {
    e.preventDefault();
    setIsServicesOpen(!isServicesOpen);
    setActiveLink('services');
  };

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  // Close dropdown when clicking outside
  useEffect(() => {
    const handleClickOutside = (event) => {
      if (dropdownRef.current && !dropdownRef.current.contains(event.target)) {
        setIsServicesOpen(false);
      }

      if (mobileMenuRef.current && !mobileMenuRef.current.contains(event.target) && 
          !event.target.closest('.mobile-menu-toggle')) {
        setIsMobileMenuOpen(false);
      }
    };

    document.addEventListener('mousedown', handleClickOutside);
    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, [dropdownRef, mobileMenuRef]);

  return (
    <NavbarContainer>
      <Logo />
      <NavLinks>
        <NavItem isActive={activeLink === 'home'}>
          <NavLink 
            href="/" 
            onClick={(e) => handleLinkClick('home', e)}
            isActive={activeLink === 'home'}
          >
            Home
            {activeLink === 'home' && <ActiveIndicator />}
          </NavLink>
        </NavItem>
        <NavItem isActive={activeLink === 'about'}>
          <NavLink 
            href="/about" 
            onClick={(e) => handleLinkClick('about', e)}
            isActive={activeLink === 'about'}
          >
            About Us
            {activeLink === 'about' && <ActiveIndicator />}
          </NavLink>
        </NavItem>
        <NavItem isActive={activeLink === 'services'} ref={dropdownRef}>
          <NavLink 
            href="/services" 
            onClick={toggleServicesDropdown}
            isActive={activeLink === 'services'}
            hasDropdown={true}
          >
            Services <DropdownIcon isOpen={isServicesOpen}>▼</DropdownIcon>
            {activeLink === 'services' && <ActiveIndicator />}
          </NavLink>
          {isServicesOpen && (
            <DropdownMenu>
              <DropdownTriangle />
              <DropdownItem>
                <DropdownLink 
                  href="/services/ai-agents"
                  onClick={(e) => {
                    e.preventDefault();
                    // Handle navigation in a real app
                    setIsServicesOpen(false);
                  }}
                >
                  AI Agents
                </DropdownLink>
              </DropdownItem>
              <DropdownItem>
                <DropdownLink 
                  href="/services/machine-learning"
                  onClick={(e) => {
                    e.preventDefault();
                    // Handle navigation in a real app
                    setIsServicesOpen(false);
                  }}
                >
                  Machine Learning
                </DropdownLink>
              </DropdownItem>
              <DropdownItem>
                <DropdownLink 
                  href="/services/cloud-services"
                  onClick={(e) => {
                    e.preventDefault();
                    // Handle navigation in a real app
                    setIsServicesOpen(false);
                  }}
                >
                  Cloud Services
                </DropdownLink>
              </DropdownItem>
              <DropdownItem>
                <DropdownLink 
                  href="/services/mobile-app-development"
                  onClick={(e) => {
                    e.preventDefault();
                    // Handle navigation in a real app
                    setIsServicesOpen(false);
                  }}
                >
                  Mobile App Development
                </DropdownLink>
              </DropdownItem>
              <DropdownItem>
                <DropdownLink 
                  href="/services/web-app-development"
                  onClick={(e) => {
                    e.preventDefault();
                    // Handle navigation in a real app
                    setIsServicesOpen(false);
                  }}
                >
                  Web App Development
                </DropdownLink>
              </DropdownItem>
              <DropdownItem>
                <DropdownLink 
                  href="/services/ui-ux-design"
                  onClick={(e) => {
                    e.preventDefault();
                    // Handle navigation in a real app
                    setIsServicesOpen(false);
                  }}
                >
                  UI/UX Design
                </DropdownLink>
              </DropdownItem>
            </DropdownMenu>
          )}
        </NavItem>
        <NavItem isActive={activeLink === 'contact'}>
          <NavLink 
            href="/contact" 
            onClick={(e) => handleLinkClick('contact', e)}
            isActive={activeLink === 'contact'}
          >
            Contact Us
            {activeLink === 'contact' && <ActiveIndicator />}
          </NavLink>
        </NavItem>
      </NavLinks>

      <RightSide>
        <CtaButton href="/schedule">Schedule a call</CtaButton>
        <MobileMenuToggle 
          className="mobile-menu-toggle" 
          onClick={toggleMobileMenu}
          isOpen={isMobileMenuOpen}
        >
          <span></span>
          <span></span>
          <span></span>
        </MobileMenuToggle>
      </RightSide>

      {isMobileMenuOpen && (
        <MobileMenu ref={mobileMenuRef}>
          <MobileMenuLink 
            href="/" 
            isActive={activeLink === 'home'}
            onClick={(e) => handleLinkClick('home', e)}
          >
            Home
          </MobileMenuLink>
          <MobileMenuLink 
            href="/about"
            isActive={activeLink === 'about'}
            onClick={(e) => handleLinkClick('about', e)}
          >
            About Us
          </MobileMenuLink>

          <MobileMenuAccordion>
            <MobileMenuAccordionHeader 
              onClick={(e) => {
                e.preventDefault();
                toggleServicesDropdown(e);
              }}
              isActive={activeLink === 'services'}
            >
              Services <DropdownIcon isOpen={isServicesOpen}>▼</DropdownIcon>
            </MobileMenuAccordionHeader>

            {isServicesOpen && (
              <MobileSubmenu>
                <MobileSubmenuLink 
                  href="/services/ai-agents"
                  onClick={(e) => handleLinkClick('services', e)}
                >
                  AI Agents
                </MobileSubmenuLink>
                <MobileSubmenuLink 
                  href="/services/machine-learning"
                  onClick={(e) => handleLinkClick('services', e)}
                >
                  Machine Learning
                </MobileSubmenuLink>
                <MobileSubmenuLink 
                  href="/services/cloud-services"
                  onClick={(e) => handleLinkClick('services', e)}
                >
                  Cloud Services
                </MobileSubmenuLink>
                <MobileSubmenuLink 
                  href="/services/mobile-app-development"
                  onClick={(e) => handleLinkClick('services', e)}
                >
                  Mobile App Development
                </MobileSubmenuLink>
                <MobileSubmenuLink 
                  href="/services/web-app-development"
                  onClick={(e) => handleLinkClick('services', e)}
                >
                  Web App Development
                </MobileSubmenuLink>
                <MobileSubmenuLink 
                  href="/services/ui-ux-design"
                  onClick={(e) => handleLinkClick('services', e)}
                >
                  UI/UX Design
                </MobileSubmenuLink>
              </MobileSubmenu>
            )}
          </MobileMenuAccordion>

          <MobileMenuLink 
            href="/contact"
            isActive={activeLink === 'contact'}
            onClick={(e) => handleLinkClick('contact', e)}
          >
            Contact Us
          </MobileMenuLink>

          <MobileCta href="/schedule">
            Schedule a call
          </MobileCta>
        </MobileMenu>
      )}
    </NavbarContainer>
  );
};

